import React from 'react';
import './order.css';

const Order = () => {
  // const {register,handleSubmit} = useForm();
  // const onSubmit = data => console.log(data);

  return (
    <ThemeProvider theme={theme}>
      <div className='order-form-container'>
        <div className='order-head'>Order</div>

        <form onSubmit={handleSubmit(onSubmit)}>
          <TextField
            {...register('title')}
            id='title'
            name='title'
            label='Project Title'
            variant='standard'
            margin='normal'
            color='primary'
            sx={{ width: '40ch' }}
            onChange={handleChange}
          />

          <TextField
            {...register('client')}
            sx={{ width: '40ch' }}
            id='client'
            name='client'
            label='client'
            variant='standard'
            margin='normal'
          />

          <TextField
            {...register('description')}
            sx={{ width: '40ch' }}
            label='Description'
            name='description'
            variant='standard'
            multiline
            margin='normal'
            id='password'
            type='password'
          />

          <label htmlFor='icon-button-file'>
            <Input accept='image/*' id='icon-button-file' type='file' />
            <IconButton
              color='primary'
              aria-label='upload picture'
              component='span'
            >
              <PhotoCamera />
            </IconButton>
          </label>

          <Button
            variant='contained'
            size='medium'
            margin='normal'
            value='submit'
            type='submit'
            sx={{
              width: '10ch',
              display: 'block',
            }}
          >
            submit
          </Button>
        </form>
      </div>
    </ThemeProvider>
  );
};

export default Order;
